webpackJsonp([6214912377808],{570:function(A,t){A.exports={data:{site:{siteMetadata:{title:"Eh, I Could Eat",author:"Jacob Aronoff"}},markdownRemark:{id:"/Users/jea/Documents/Code/github/icouldeat/src/pages/raclette/index.md absPath of file >>> MarkdownRemark",html:'<h3>Regular Raclette</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/picture-898ce4c6f1f0217218680dcb6a9d6462-99c36.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Raclette"\n        title=""\n        src="/static/picture-898ce4c6f1f0217218680dcb6a9d6462-f8fb9.jpg"\n        srcset="/static/picture-898ce4c6f1f0217218680dcb6a9d6462-e8976.jpg 148w,\n/static/picture-898ce4c6f1f0217218680dcb6a9d6462-63df2.jpg 295w,\n/static/picture-898ce4c6f1f0217218680dcb6a9d6462-f8fb9.jpg 590w,\n/static/picture-898ce4c6f1f0217218680dcb6a9d6462-85e3d.jpg 885w,\n/static/picture-898ce4c6f1f0217218680dcb6a9d6462-d1924.jpg 1180w,\n/static/picture-898ce4c6f1f0217218680dcb6a9d6462-9452e.jpg 1770w,\n/static/picture-898ce4c6f1f0217218680dcb6a9d6462-99c36.jpg 3024w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Today I went to Raclette in the lower east side, and had their namesake; raclette! Basically it’s roasted potatoes, prosciutto, some random vegetables and a side salad, with some very melty cheese on top of it. I got the porcini raclette swiss cheese. Overall it was pretty good, but definitely overpriced. It was around $23 if memory serves, which given the size and the taste was too much. I’d say it was worth $13 maximum. Honestly I’d give this a higher rating if it wasn’t so expensive.</p>\n<p>Rating: 5/10</p>',frontmatter:{title:"Raclette",date:"January 08, 2018"}}},pathContext:{slug:"/raclette/",previous:!1,next:{fields:{slug:"/mud-spot/"},frontmatter:{title:"Mud Spot"}}}}}});
